import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Communities.css';

export default function Communities() {
  const navigate = useNavigate();

  const classes = [
    { id: 1, title: "Mathematics", teacher: "Prof. Smith" },
    { id: 2, title: "Biology", teacher: "Dr. Reyes" },
    { id: 3, title: "History", teacher: "Mr. Lopez" },
    { id: 4, title: "Chemistry", teacher: "Ms. Cruz" },
    { id: 5, title: "Programming", teacher: "Engr. Santos" },
    { id: 6, title: "Physics", teacher: "Dr. Johnson" },
    { id: 7, title: "Statistics", teacher: "Prof. Lee" },
  ];

  const handleViewClick = (cls) => {
    navigate("/msteams/communities/activity", { state: { cls } });
  };

  return (
    <div className="class-grid-container">
      {classes.map((cls) => (
        <div key={cls.id} className="class-card">
          <div className="class-card-header"></div>
          <div className="class-card-body">
            <p className="class-title">Title: <span>{cls.title}</span></p>
            <p className="class-teacher">Teacher: <span>{cls.teacher}</span></p>
            <button
              className="class-view"
              onClick={() => handleViewClick(cls)}
            >
              view
            </button>
          </div>
        </div>
      ))}
    </div>
  );
}
